import React, { useState, useEffect } from "react";

function Weather() {
  const [data, setData] = useState("");
  const url =
    "https://api.openweathermap.org/data/3.0/onecall?lat=37.7621407&lon=-122.4745359&appid=6d794b4b65ee6ae6ad174f26bb0daf29&exclude=minutely,daily,hourly";

  useEffect(() => {
    fetch(url)
      .then((response) => response.json())
      .then((data) => setData(data));
  });

  return (
    <>
      <p>{data[0].current}</p>
    </>
  );
}

export default Weather;
